tables.table_schema:
CREATE TABLE quantum_data (
    data_id UUID PRIMARY KEY,
    data_name STRING,
    quantum_features JSONB
);

CREATE TABLE classical_data (
    data_id UUID PRIMARY KEY,
    data_name STRING,
    classical_features JSONB
);

CREATE TABLE data_analysis (
    analysis_id UUID PRIMARY KEY,
    analysis_name STRING,
    analysis_result JSONB
);

CREATE TABLE quantum_computers (
    computer_id UUID PRIMARY KEY,
    computer_name STRING,
    quantum_processing_units INT,
    qubit_capacity INT
);
